import React, { useState, useEffect } from "react";
import JewelleryCard from "./JewelleryCard";

const JewelleryList = () => {
  const [jewelleryList, setJewelleryList] = useState([]);

  useEffect(() => {
    fetch("https://dummyapi.io/data/api/jewelry?limit=10", {
      headers: {
        "app-id": "61527b09f7b2fa1d8c7c9d11", // Replace with your own app-id
      },
    })
      .then((response) => response.json())
      .then((data) => setJewelleryList(data.data))
      .catch((error) => console.log(error));
  }, []);

  return (
    <div className="container">
      <div className="row">
        {jewelleryList.map((jewellery) => (
          <div className="col-12 col-md-6 col-lg-4 mb-4" key={jewellery.id}>
            <JewelleryCard jewellery={jewellery} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default JewelleryList;
